import { Link } from 'react-router-dom';
import { useState } from 'react';
import { useNavigate } from 'react-router-dom';
// import { useEffect } from 'react';

const Navbar = () => {
  let Navigate = useNavigate();
  const [isNavHidden, setIsNavHidden] = useState(false);
  const NavReduce = ()=>{
    
    let lastScrollY = window.scrollY;

    window.addEventListener("scroll", () => {
        if (lastScrollY < window.scrollY) {
            setIsNavHidden(true);
        } else {
            setIsNavHidden(false);
        }
        lastScrollY = window.scrollY;
    });


}

    return (
        <div className=" bg-neutral-900">
                  {NavReduce()}

        <div className="navbar-start">
          <div className="dropdown">
 
            <ul tabIndex={0} className=" flex   shadow  text-white r w-52">
              <li className='m-2  '><Link to='/'>Home</Link></li>
              <li className='m-2  '><Link to='/about'>About</Link></li>
              <li className='m-2  '><Link to='/projects'>Projects</Link></li>
              <li className='m-2  '><Link to='/contact'>Contact</Link></li>
            </ul>
          </div>
        </div>
        {/* <div className="navbar-center">
          <Link to='/'  className=" btn-ghost normal-case text-xl text-white">Jack</Link>
        </div> */}
        <div className="navbar-end">

        </div>
                  </div>
    );
};

export default Navbar;
